import React from 'react'
import Person from './Person'
function NameList() {
    const person=[
        {   id:1,
            name:"dipen",
            mo:"9537923795",

        },
        {
            name:"dipen mavani",
            mo:"9537923795",

        }
    ]
    const persomap=person.map( p =><Person person={p}></Person>)
    return (
        <div>
            {persomap}
        </div>
    )
}

export default NameList
